import React, { Component } from "react";
import "./Categorization.css";

export default class Categorization extends Component {
  render() {
    return (
      <div className="Categorization">
        <ul className="categorization-wrapper">
          <li className="category">Category<i class="fas fa-plus"></i></li>
          <li className="subcategory">Subcategory<i class="fas fa-plus"></i></li>
          <li className="brands">Brands<i class="fas fa-plus"></i></li>
          <li className="weight">Weight<i class="fas fa-plus"></i></li>
          <li className="size">Size<i class="fas fa-plus"></i></li>
          <li className="color">Color<i class="fas fa-plus"></i></li>
        </ul>
      </div>
    );
  }
}
